import './App.css';
import HeroImage from "./pictures/MagdaHero.jpg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'
import { useTrail,animated } from '@react-spring/web';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowUpRightFromSquare} from '@fortawesome/free-solid-svg-icons';




function App() {
  return (
    <div>

      <div className='fixed z-30 w-screen'>
        <NavBar></NavBar>
      </div>

    <Parallax pages={4}>
      <ParallaxLayer factor={1} speed={0.5}>
        <div className=" h-screen flex justify-center items-center">
          <HeroText></HeroText>
        </div>
      </ParallaxLayer>
      <ParallaxLayer offset={0.6} speed={0.75}>
        <HeroSubText></HeroSubText>
      </ParallaxLayer>
      <ParallaxLayer className='z-10' speed={0.75} offset={0.999} factor={3}>
        <ProjectWrapper></ProjectWrapper>
      </ParallaxLayer>
      <ParallaxLayer offset={3}>
        <AboutMe className="z-20"></AboutMe>
      </ParallaxLayer>
    </Parallax>
    </div>
  );

}
function NavBar(){
      return(
        <div className='font-Nunito font-thin text-2xl '>
          <nav className="flex justify-between items-center content-center">
          <a className='m-5 text-3xl flex items-center gap-1' href='./index'> <span className=' bg-botticelli-800 rounded-full block w-2 h-2'></span>Magda Nemes</a>
            <ul className='flex gap-4 items-center'>
              <li >About</li>
              <li>Projects</li>
            </ul>
            <a className='mx-10' href='./'>Contact Me</a>
          </nav>
          <CreateLine></CreateLine>
        </div>
      )
}


function HeroImageDisplay(){
  const [trails, api] = useTrail(1, () => ({
    from: { opacity: 0 },
    to: { opacity: 1 },
    config: { mass: 1, tension: 300, friction: 100 }
  }));

        return(
          <div>
          {trails.map(()=>(
            <animated.div>

              <div className='flex'>
                  <div className='bg-buttercup-400 rounded-full w-[58rem]'>
                    <img src={HeroImage} className="w-56 h-auto rounded-full mx-10" alt="HeroImage"></img>
                  </div>
              </div>

            </animated.div>

            )
          )
          }
          </div>
        )

}


  function HeroText() {
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 200, friction: 150 }
    }));

    return (
      <div>
        {trails.map((props,index) => (
          <animated.div style={props} key={index+1} className="  text-center font-normal ">
           <h1 className='text-gun-powder-950 text-[10rem] font-Montseratt'>Magda Nemes</h1>

          </animated.div>
        ))}
      </div>
    );
  }

  function HeroSubText(){
    const [trails] = useTrail(1, () => ({
      from: { opacity: 0 },
      to: { opacity: 1 },
      config: { mass: 1, tension: 100, friction: 150 }
    }));

    return (
      <div>
        {trails.map((props,index) => (
          <animated.div style={props} key={index+1} className="  text-center font-normal ">
           <h1 className=' text-botticelli-800 text-[5rem] font-Nunito font-light'>Architect</h1>
          </animated.div>
        ))}
      </div>
    );
  }

  function CreateLine(){



    return( <div className='flex'>
              <span className='block w-56 h-1 border-x-1 mr-2 bg-botticelli-800 overflow-hidden'></span>
              <div>
                <span className='block w-14 h-1 border-x-1 bg-botticelli-800 overflow-hidden'></span>
                <span className='block w-14 h-1 border-x-1 bg-botticelli-800 overflow-hidden rotate-90'></span>
              </div>
            </div>
      )
  }

function ProjectWrapper(){
  return(
    <div className='flex flex-col bg-green-kelp-950 rounded-3xl'>
      <h1 className='text-6xl m-10 text-center font-Montserrat text-moon-mist-100'>Projects: </h1>
      <div className='flex items-start'>
        <img className='m-10' src='https://i.pinimg.com/564x/81/03/2b/81032b6ba1084935fe0fb0ab7eafb2f7.jpg' width={400} height={600} alt="firstProject"></img>
        <div className='flex flex-col text-moon-mist-100'>
          <h1 className='text-4xl font-Nunito '>Project 1 <FontAwesomeIcon className='text-3xl' icon={faArrowUpRightFromSquare} /></h1>
          <br></br>
          <p className='text-2xl font-Nunito border-2 border-moon-mist-100 p-4 w-80'>
            Urban Haven Apartments, a contemporary oasis nestled in the heart 
            of the bustling cityscape. This boutique residential complex redefines urban living,
             offering a perfect blend of style, comfort, and convenience in compact yet sophisticated suites.
          </p>
        </div>
      </div>     
      <div className='flex items-start'>
        <img className='m-10' src='https://i.pinimg.com/564x/f8/17/b5/f817b54bc5c8df0d8a3b6d3c8335f389.jpg' width={400} height={600} alt="firstProject"></img>
        <div className='flex flex-col text-moon-mist-100'>
          <h1 className='text-4xl font-Nunito '>Project 2 <FontAwesomeIcon className='text-3xl' icon={faArrowUpRightFromSquare} /></h1>
          <br></br>
          <p className='text-2xl font-Nunito border-2 border-moon-mist-100 p-4 w-80'>
          Urban Heights Residence embraces a sleek and minimalist design aesthetic, characterized by clean lines, expansive windows, 
